import React from 'react';
import { connect } from "react-redux";
import { Link } from "react-router-dom";
import profile from '../media/images/conan.png'
import FontAwesomeIcon from "react-fontawesome"

function Inbox(props) {
    return (
        <div className={`inbox rel`}>
            {/* Header | UserBox */}
            <div className={`userbox flex`}>
                <Link to="#" className={`user`}>
                    <img src={profile} height="50" width="50"/>
                </Link>
                <div className={`actions rel flex aic`}>
                    <button className={` fa-message s24`}/>
                    <FontAwesomeIcon icon="fa-solid fa-message-lines" />
                </div>
            </div>
        </div>
    );
}

const mapStateToProps = state => {
    return {
        loaded: state.App.loaded
    }
}

const mapDispatchToProps = dispatch => {
    return {
        setState: (loaded) => dispatch({ type: "APP_STATE", state: { loaded: loaded }})
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(Inbox);
